import React from "react";

const Selector = (
  title,
  option_1,
  option_2,
  option_3,
  option_4,
  option_5,
  option_6,
  name_1,
  name_2,
  name_3,
  name_4,
  name_5,
  name_6
) => {
  const [selection, setSelection] = useState("");
  const updateSelection = (e) => {
    const {
      target: { value },
    } = e;
    setSelection(value);
    console.log(value);
  };
  <li className="option-container">
    <h2 className="option-title">{title}</h2>
    <select className="js-life" onChange={updateSelection}>
      <option value="none">선택하세요</option>
      <option value={option_1}>{name_1}</option>
      <option value={option_2}>{name_2}</option>
      <option value={option_3}>{name_3}</option>
      <option value={option_4}>{name_4}</option>
      <option value={option_5}>{name_5}</option>
      <option value={option_6}>{name_6}</option>
    </select>
  </li>;
};

export default Selector;
